import React, { useState, useEffect } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { auth } from '../firebaseConfig';
import './Header.css';

function Header() {
  const [user, setUser] = useState(null);
  const navigate = useNavigate();

  useEffect(() => {
    const unsubscribe = auth.onAuthStateChanged((currentUser) => {
      setUser(currentUser);
    });
    return () => unsubscribe();
  }, []);

  const handleLogout = () => {
    auth.signOut();
    navigate('/sign-in');
  };

  return (
    <header className="header">
      <div className="header-left">
        <Link to="/" className="logo">BookMyService</Link>
        <nav className="nav-links">
          <Link to="/clients">Clients</Link>
          <Link to="/service-providers">Service Providers</Link>
          <Link to="/projects">Projects</Link>
          <Link to="/messages">Messages</Link>
        </nav>
      </div>

      <div className="header-right">
        <div className="search-bar">
          <input type="text" placeholder="Search..." />
        </div>

        <div className="profile-menu">
          <img src="/path-to-profile-icon" alt="Profile" className="profile-icon" />
          <ul className="dropdown">
            {!user ? (
              <>
                <li><Link to="/sign-in">Log In</Link></li>
                <li><Link to="/sign-up">Create Account</Link></li>
              </>
            ) : (
              <>
                <li><Link to="/profile">Go to Profile</Link></li>
                <li><button onClick={handleLogout} className="logout-button">Sign Out</button></li>
              </>
            )}
          </ul>
        </div>
      </div>
    </header>
  );
}

export default Header;
